import React from 'react';

class Titles extends React.Component{
    render(){
        return(
            <div>
                <h1 className="title-container__title">Weather Finder</h1>
                <h3>Find out temperature, conditions and more...</h3>
            </div>
        );
    }
}

export default Titles;
